query:
reserve X, Y for set; 
 reserve x for object; 
 X <> Y implies ex x being object st x in X /\ Y;

reserve X, Y for set; 
 reserve x for object; 
 ex f being Function of X , Y st Y <> {} & x in X & not ( f . x in Y) ;

reserve Y for set; 
 reserve X for non empty set; 
 reserve s for sequence of X; 
 rng s > Y implies ex n st not (s . n in Y);

reserve i for natural Number; 
 reserve D for non empty set; 
 reserve q for FinSequence; 
 ex f being sequence of D st q = f|(Seg i) & not (len q = i);
